import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const HomePageBox_Two = () => {
    return (
        <View style={styles.box_two_container}>
            <View style={styles.box_two_heading}>
                <Text style={styles.box_two_Style}>Our Staf</Text>
                <Text style={styles.box_two_btn_btnStyle}>Show All</Text>
            </View>

            <View style={styles.box_two__box}>
                <View style={styles.box_one}>
                    <Text>ofgdf</Text>
                    <Text>dfnkfg</Text>
                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    box_two_container: {
        marginTop: '10%',
        height: '50px',
        width: '100%',
    },
    box_two_heading: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        padding: "10px",
        margin: '10px',
    },
    box_two_Style: {
        color: "#102C56",
        fontSize: '19px',
        lineHeight: "14px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    box_two_btn_btnStyle: {
        color: "#F98700",
        fontSize: '17px',
        lineHeight: "18px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    box_two__box: {
        padding: '20px',
        flex: 1,
        flexDirection: "row",
        justifyContent: 'center-between',
        alignItems: 'center',
    },
    box_one: {
        position: 'absolute',
        width: '106px',
        height: '115px',
        left: '2px',
        top: '16px',
        background: '#808080',
        boxShadow: '0px 15px 40px rgba(18, 194, 214, 0.12)',
        borderadius: '15px',
    },
    box_one_img: {
        position: ' absolute',
        width: ' 62px',
        height: ' 62px',
        left: '25px',
        top: ' 7px',
        borderRadius: '10px',
    }
})

export default HomePageBox_Two;
